import React, { useState } from "react";
import { Grid, MantineProvider, createTheme } from "@mantine/core";
import "@mantine/core/styles.css";
import NavbarSegmented from "./views/components/Header/NavbarSegmented";

const theme = createTheme({
  fontFamily: "Open Sans, sans-serif",
  primaryColor: "cyan",
});

function App() {
  return <MantineProvider theme={theme}>
    <Grid>
      <Grid.Col span={2}></Grid.Col>
    </Grid>
    <NavbarSegmented />
  </MantineProvider>;
}

export default App;
